import './App.css';
import New from './pages/New';
import { Routes, Route } from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <Home />
      <Routes>
        <Route path='/new' element={<New/>}></Route>
      </Routes>
    </div>
  );
}

export default App;
